	local ROT = Vector3.new(0,0,0)
	local VEC = Vector3.new(0,0.5,0)
	
	local Msgreq = function(Title,Text,Duration,Button1Text,Button2Text)
		if ScriptSettings[5][2] == true then
		game.StarterGui:SetCore("SendNotification", {
			Title = Title;
			Text = Text;
			Icon = "";
			Duration = Duration;
			Button1 = Button1Text;
